import { useState, useEffect } from "react"
import axios from "axios"

function Signup() {
    const [email, setEmail] = useState('')
    const [password, setPassword] = useState('')
    const [error, setError] = useState('')
    const [selectData, setSelectData] = useState([])
    const [selectValue, setSelectValue] = useState('')

    useEffect( () => {
        let processing = true
        // axiosFetchData(processing)
        return () => {
            processing = false
        }
    },[])

    // const axiosFetchData = async(processing) => {
    //     await axios.get('http://localhost:4000/users')
    //     .then(res => {
    //         if (processing) {
    //             setSelectData(res.data)
    //         }
    //     })
    //     .catch(err => console.log(err))
    // }

    const axiosPostData = async() => {
        const postData = {
            email: email,
            password: password
            // website: selectValue
        }

        await axios.post('http://localhost:4000/signin/send', postData)
        .then(res => setError(<p className="success">{res.data}</p>))
    }

    const SelectDropdown = () => {
        return (
            <select value={selectValue} onChange={(e) => setSelectValue(e.target.value)}>
                <option value="" key="none"> -- Select One -- </option>
                {
                    selectData?.map( (item) => (
                        <option value={item.website} key={item.website}>{item.website}</option>
                    ))
                }
            </select>
        )
    }

    const handleSubmit = (e) => {
        e.preventDefault()

        if (!email || !password) {
            setError(<p className="required">Email/Password is empty. Please enter a valid email/password.</p>)
        } else {
            setError('')
            axiosPostData()
        }
    }

    return (
        <>
            <h1>Sign Up</h1>

            <form className="form">
                <label>Email</label>
                <input type="text" id="email" name="email" value={email} onChange={(e) => setEmail(e.target.value)} />
                <label>Password</label>
                <input type="text" id="password" name="password" value={password} onChange={(e) => setPassword(e.target.value)} />

                <label>Are you registering a Student or a Club account?</label>
                <SelectDropdown />

                <label>Already have an account? Click here to sign in!</label>
                {error}

                <button type="submit" onClick={handleSubmit}>Submit</button>
            </form>
        </>
    )
}

export default Signup
